Static variables and register variables are two types of variables in C programming language.

1. Static variables:
A static variable is a variable that has been allocated statically, i.e., at compile time. It retains its value between function calls and is initialized only once, at the first function call. Static variables are declared using the keyword "static" before the variable name.

Here is an example of a static variable:
```c
#include <stdio.h>

void increment() {
    static int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    increment();
    return 0;
}
```
In this example, the variable "count" is declared as static inside the function "increment". The value of "count" is retained between function calls, and it is initialized only once, at the first function call.

2. Register variables:
A register variable is a variable that is stored in a register of the CPU instead of RAM. This can improve the performance of the program because accessing a register is faster than accessing RAM. However, the number of registers is limited, and the compiler may not always be able to store a variable in a register.

Here is an example of a register variable:
```c
#include <stdio.h>

int main() {
    register int i;
    for (i = 0; i < 1000000; i++) {
        // do something
    }
    return 0;
}
```
