To make the code run only once every 0.6 seconds, you can use a debouncing technique. Debouncing is a technique used to limit the rate at which a function can be called.

Here's how you can modify your code to achieve this:

```javascript
import { useEffect, useRef } from 'react';
import gsap from 'gsap';

const MyComponent = () => {
  const tl = useRef(gsap.timeline());
  const portfolioCurrent = useRef(null);
  const portfolioNext = useRef(null);
  const debounceTimeout = useRef(null);

  useEffect(() => {
    if (debounceTimeout.current) {
      clearTimeout(debounceTimeout.current);
    }

    debounceTimeout.current = setTimeout(() => {
      tl.current.set(portfolioNext.current, {
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
      });
      tl.current.set(portfolioNext.current, {
        css: { backgroundImage: 'url(' + cursor.cursorImage + ')' },
      });

      tl.current.to(portfolioCurrent.current, {
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
        duration: 0.5,
      });

      tl.current.to(portfolioNext.current, {
        clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
        delay: 0.1,
        duration: 0.5,
      });

      tl.current.set(portfolioCurrent.current, {
        clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
      });

      tl.current.set(portfolioCurrent.current, {
        css: { backgroundImage: 'url(' + cursor.cursorImage + ')' },
      });
    }, 600);

    return () => {
      if (debounceTimeout.current) {
        clearTimeout(debounceTimeout.current);
      }
    };
  }, [cursor.cursorImage]);

  return (
    // Your component JSX
  );
};
```

In this code, I've added a `debounceTimeout` ref to store the timeout ID returned by `setTimeout`. Before setting a new timeout, I check if there's an existing one and clear it if there is. This ensures that the code inside the timeout will only run once every 0.6 seconds.

Also, I've added a cleanup function to the `useEffect` hook to clear the timeout when the component unmounts. This is to prevent memory leaks.

In TypeScript, you can get user input from the command line using the `readline` module. Here's an example of how to do this:

```typescript
import * as readline from 'readline';

const rl = readline.createInterface({
  input: process.stdin,
  output: process.stdout
});

rl.question('Please enter your name: ', (name) => {
  console.log(`Hello, ${name}!`);
  rl.close();
});
```

In this example, `readline.createInterface` is used to create an interface that reads input from `stdin` (standard input) and writes output to `stdout` (standard output). The `rl.question` method is then used to prompt the user for input, and a callback function is provided to handle the input.

When the user enters their name and presses enter, the callback function is called with the user's input as its argument. In this case, the callback function simply logs a greeting to the console and then closes the `readline` interface.

Note that you'll need to have the `readline` module installed in your project in order to use this code. You can install it using npm:

```
npm install @types/node
```

This will install the TypeScript definitions for Node.js, which includes the `readline` module.

